CREATE TABLE TIPO(
   ID        INTEGER  NOT NULL PRIMARY KEY 
  ,DESCRICAO VARCHAR(8) NOT NULL
);

CREATE TABLE WEATHER(
   ID        INTEGER  NOT NULL PRIMARY KEY 
  ,DESCRICAO VARCHAR(13) NOT NULL
);

CREATE TABLE IF NOT EXISTS POKEMON(
   ID              INTEGER  NOT NULL PRIMARY KEY 
  ,NAME            VARCHAR(27) NOT NULL
  ,POKEDEX_NUMBER  INTEGER  NOT NULL
  ,IMG_NAME        VARCHAR(11) NOT NULL
  ,GENERATION      INTEGER  NOT NULL
  ,EVOLUTION_STAGE VARCHAR(7)
  ,EVOLVED         BIT  NOT NULL
  ,FAMILY_ID       INTEGER 
  ,CROSS_GEN       BIT  NOT NULL
  ,STAT_TOTAL      INTEGER  NOT NULL
  ,ATK             INTEGER  NOT NULL
  ,DEF             INTEGER  NOT NULL
  ,STA             INTEGER  NOT NULL
  ,LEGENDARY       INTEGER  NOT NULL
  ,AQUIREABLE      INTEGER  NOT NULL
  ,SPAWNS          BIT  NOT NULL
  ,REGIONAL        BIT  NOT NULL
  ,RAIDABLE        INTEGER  NOT NULL
  ,HATCHABLE       INTEGER  NOT NULL
  ,SHINY           BIT  NOT NULL
  ,NEST            BIT  NOT NULL
  ,NEW             BIT  NOT NULL
  ,NOT_GETTABLE    BIT  NOT NULL
  ,FUTURE_EVOLVE   BIT  NOT NULL
  ,CP40            INTEGER  NOT NULL
  ,CP39            INTEGER  NOT NULL
);

CREATE TABLE IF NOT EXISTS POKEMON_WEATHER(
   ID_POKEMON INTEGER  NOT NULL
  ,ID_WEATHER INTEGER  NOT NULL
  ,PRIMARY KEY(ID_POKEMON,ID_WEATHER)
);

CREATE TABLE POKEMON_TIPO(
   ID_POKEMON INTEGER  NOT NULL
  ,ID_TIPO    INTEGER  NOT NULL
  ,PRIMARY KEY(ID_POKEMON,ID_TIPO)
);

